        let sideNameData = headTitle?.data
        for (let idx in sideNameData) {
            console.log('sideNameData[idx]', sideNameData[idx]);
            return <SideNavMain className="text-[18px]">{sideNameData[idx].name}</SideNavMain>
        }
    }

    // {sideNavMap.map(sideNavMap => (
